import { FC } from 'react';
import Layout from '../components/Layout';
import Link from 'next/link';

const Signup:FC = () => {
  return (
    <Layout>
      <Link href="/">
        <a>HOME</a>
      </Link>
      <h2>Signup page</h2>
    </Layout>
  );
};

export default Signup;
